import React, { useState } from 'react';
import "../fonts/icomoon/style.css";

export default function Navbar() {
  const [isMenuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setMenuOpen(false);
  };

  return (
    <>
      <div className={`site-mobile-menu site-navbar-target ${isMenuOpen ? 'open' : ''}`}>
        {/* Mobile menu content */}
        <div className="site-mobile-menu-header">
          <div className="site-mobile-menu-close mt-3">
            <span className="icon-close2 js-menu-toggle" onClick={closeMenu} />
          </div>
        </div>
        <div className="site-mobile-menu-body" />
      </div>
      <div className="site-navbar-wrap">
        {/* Rest of the navigation bar code */}
        <div className="site-navbar site-navbar-target js-sticky-header">
          {/* Navigation bar content */}
          <div className="container">
            <div className="row align-items-center">
              <div className="col-2">
                <h1 className="my-0 site-logo">
                  <a href="index.html">Brand</a>
                </h1>
              </div>
              <div className="col-10">
                <nav className="site-navigation text-right" role="navigation">
                  {/* Navigation menu content */}
                  <div className="container">
                    <div className="d-inline-block d-lg-none ml-md-0 mr-auto py-3">
                      <a
                        href="#"
                        className={`site-menu-toggle js-menu-toggle text-white ${isMenuOpen ? 'active' : ''}`}
                        onClick={toggleMenu}
                      >
                        <span className="icon-menu h3" />
                      </a>
                    </div>
                    <div className="openMenu">
                      <i className="fa fa-bars" onClick={toggleMenu} />
                    </div>
                    {/* Rest of the menu items */}
                    <ul className={`site-menu main-menu js-clone-nav d-none d-lg-block ${isMenuOpen ? 'show' : ''}`}>
                      {/* Menu items */}
                      <li className="active">
                        <a href="#home-section" className="nav-link">
                          Home
                        </a>
                      </li>
                      {/* Include other menu items here */}
                    </ul>
                    <div className="closeMenu" onClick={closeMenu}>
                      <i className="fa fa-times" />
                    </div>
                  </div>
                </nav>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}













